Blackwater Valley Exorcism (2006)


Emotionally disturbed Isabelle is locked in a fierce battle with a vicious 

demon that's hell-bent on owning her soul. Desperate to bring her back from 

the tangle of evil, her family calls on Jacob, the troubled local priest, 

to perform an exorcism. In a race against time and terror, he must wrestle 

his own dark demons before he can save Isabelle. But she isn't the only one 

who needs saving...


